import "../css/Game.css";
import Help from "./Help";
import TetrisHeader from "./TetrisHeader";





const Game = () => {
    return(
        <div className="Game">
            <TetrisHeader />
            <div className="Tetris-home">
                <Help />
                <div>SINGLE</div>
            </div>
        </div>
    )
}
export default Game;
